import "./App.css";
import { useState } from "react";

function App() {
  const [name, setName] = useState("");
  const [age, setAge] = useState(0);
  const [country, setCountry] = useState("");
  const [position, setPosition] = useState("");
  const [Wage, setWage] = useState(0);

  return (
    <div className="App">
      <h1 className="head1">Employee Management System</h1>
      <hr className="hr1" />
      <div className="info">
        <label>Name:</label>
        <input type="text" />
      </div>

      <div className="info">
        <label>Age:</label>
        <input type="number" />
      </div>

      <div className="info">
        <label>Country:</label>
        <input type="text" />
      </div>

      <div className="info">
        <label>Position:</label>
        <input type="text" />
      </div>

      <div className="info">
        <label>Wage (Year):</label>
        <input type="number" />
      </div>
      <button className="butt">Add Employee</button>
    </div>
  );
}

export default App;
